import React, {useEffect} from 'react';
import Nav from "../components/main/Nav";
import SignUpBox from "../components/main/SignUpBox";
import IndexIntro from "../components/main/IndexIntro";
import Footer from "../components/main/Footer";
import VideoGridList from "../components/video/VideoGridList";

const Index = () => {
    useEffect(() => {
        if (localStorage.getItem("token") == null) {
            //window.location.href = "http://localhost:3000/login"
        }
    })


    const styles = {
        root: {
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            height: '100%',
        },
        layout: {
            display: 'flex',
            height: '100%',
            overflow: 'hidden',
            alignItems: 'center',
            alignContent: 'center',
            justifyContent: 'center',
            verticalAlign: 'center'
        }
    }


    return (
        <>
            <div style={styles.root}>
                <Nav/>
                <div style={styles.layout}>
                    <VideoGridList />
                </div>
                <Footer />
            </div>
        </>
    );
};

export default Index;
